import React, { useState, useEffect } from 'react';
import style from './NavBar.module.css';
import Variables from '../Variables/Variables.module.css'
import { NavLink } from 'react-router-dom';


export default function NavBar () {

    const [isSticky, setIsSticky] = useState(false);

    useEffect(() => {
        window.addEventListener('scroll', handleScroll);
        return () => {
        window.removeEventListener('scroll', handleScroll);
        };
    }, []);

    const handleScroll = () => {
        if (window.scrollY > 0) {
        setIsSticky(true);
        } else {
        setIsSticky(false);
        }
    };

    return (

    <header class="header" data-header>
        <div class="container">

        <a href="#" class="logo">
            <img src="./assets/images/logo.svg" width="160" height="50" alt="Grilli - Home" />
        </a>

        <nav class="navbar" data-navbar>

            <button class="close-btn" aria-label="close menu" data-nav-toggler>
            <ion-icon name="close-outline" aria-hidden="true"></ion-icon>
            </button>

            <a href="#" class="logo">
            <img src="./assets/images/logo.svg" width="160" height="50" alt="Grilli - Home" />
            </a>

            <ul class="navbar-list">

            <li class="navbar-item">
                <a href="#home" class="navbar-link hover-underline active">
                <div class="separator"></div>

                <span class="span">Home</span>
                </a>
            </li>

            <li class="navbar-item">
                <a href="#menu" class="navbar-link hover-underline">
                <div class="separator"></div>

                <span class="span">Menus</span>
                </a>
            </li>

            <li class="navbar-item">
                <a href="#about" class="navbar-link hover-underline">
                <div class="separator"></div>

                <span class="span">About Us</span>
                </a>
            </li>

            <li class="navbar-item">
                <a href="#" class="navbar-link hover-underline">
                <div class="separator"></div>

                <span class="span">Our Chefs</span>
                </a>
            </li>

            <li class="navbar-item">
                <a href="#" class="navbar-link hover-underline">
                <div class="separator"></div>

                <span class="span">Contact</span>
                </a>
            </li>

            </ul>

            <div class="text-center">
            <p class="headline-1 navbar-title">Visit Us</p>

            <address class="body-4">
                Restaurant St, Delicious City,
                London 9578, UK
            </address>

            <p class="body-4 navbar-text">Open: 9.30 am - 2.30pm</p>

            <a href="mailto:booking@grilli.com" class="body-4 sidebar-link">booking@grilli.com</a>

            <div class="separator"></div>

            <p class="contact-label">Booking Request</p>

            <a href="tel:+88123123456" class="body-1 contact-number hover-underline">
                +88-123-123456
            </a>
            </div>

        </nav>

        <a href="#" class="btn btn-secondary">
            <span class="text text-1">Find A Table</span>

            <span class="text text-2" aria-hidden="true">Find A Table</span>
        </a>

        <button class="nav-open-btn" aria-label="open menu" data-nav-toggler>
            <span class="line line-1"></span>
            <span class="line line-2"></span>
            <span class="line line-3"></span>
        </button>

        <div class="overlay" data-nav-toggler data-overlay></div>

        </div>
    </header>

        // <header class={style.header}>
        //     <NavLink to={'/Home'} className={style.inicio}>
        //         <a href="#" class={style.logo}>j0ak!</a>
        //     </NavLink>

        //     <nav className={style.navbar}>
        //         <NavLink to={'/Home'} className={style.navLink}>
        //             <a className={style.btn}>Home</a>
        //         </NavLink>
        //         <NavLink to={'/Recipes'} className={style.navLink}>
